class AgeRange {
    populations = {};
    b;
    M;
    url;

    constructor(_1996, _2001, _2006, _2011, _2016, m, b) {
        this.populations["1996"] = _1996;
        this.populations["2001"] = _2001;
        this.populations["2006"] = _2006;
        this.populations["2011"] = _2011;
        this.populations["2016"] = _2016;
        this.M = m;
        this.b = b;
    }

    getPopulation(year) {
        if (!dict[year]) {
            return (this.M * parseFloat(year) + this.b).toFixed(0);
        } else {
            return dict[year];
        }
    }

}


