function makePopup(name) {
    let ageRange = $("#ageRange").val();
    let year = $("#year").val();
    console.log("click");
    Swal.fire({
        title: name + "<br/> " + ageRange,
        html: popupHTML
    });

    // $("#image").attr("src", dict[name][ageRange].url);

    $("#newAge").on("input", function () {
        $("#newAgePop").text("" + dict[name][ageRange].getPopulation($("#newAge").val()));
        $("#difference").text((100 -100*parseInt($("#newAgePop").text()) / parseInt($("#previousAgePop").text())).toFixed(2) + "%");
    });

    $("#previousAge").on("input", function () {
        $("#previousAgePop").text("" + dict[name][ageRange].getPopulation($("#previousAge").val()));
        $("#difference").text((100 - 100*parseInt($("#newAgePop").text()) / parseInt($("#previousAgePop").text())).toFixed(2) + "%");
    });

    $("#newAge").val(year);
    $("#previousAge").val(year);
    $("#newAge").trigger("input");
    $("#previousAge").trigger("input");
}


